import React from 'react'


const Lemmikud = () => {
    return (
        <div className="container">
            {people && (
                <div className="row">
                    {people.map((person, index) => (
                        <div className="col-md-4" key={index}>
                            <PeopleComponent
                                picture={person.picture}
                                phone={person.phone}
                                education={person.education}
                                name={person.name}
                                id={person.id}
                                addEdited={addEdited}
                                Delete={Delete}
                            />
                        </div>
                    ))}
                </div>
            )}
        </div>
    )
}

export default Lemmikud
